import React from 'react';
import PropTypes from 'prop-types';
import { withStyles, MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';
import blue from '@material-ui/core/colors/blue';
import gray from '@material-ui/core/colors/grey';
import FormGroup from '@material-ui/core/FormGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Switch from '@material-ui/core/Switch';
import Typography from '@material-ui/core/Typography';
import { unstable_Box as Box } from '@material-ui/core/Box';
import TextField from '@material-ui/core/TextField';
import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';
import FormControl from '@material-ui/core/FormControl';
import FormLabel from '@material-ui/core/FormLabel';
import Grid from '@material-ui/core/Grid';
import NavigationIcon from '@material-ui/icons/Navigation';
import Fab from '@material-ui/core/Fab';
import Button from '@material-ui/core/Button';
import Checkbox from '@material-ui/core/Checkbox';
import FormHelperText from '@material-ui/core/FormHelperText';

const styles = theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },colorSwitchBase: {
    color: gray[700],
    '&$colorChecked': {
      color: blue[900],
      '& + $colorBar': {
        backgroundColor: blue[900],
      },
    },
  },
  colorBar: {
     borderRadius: 13,
    width: 42,
    height: 26,
    marginTop: -13,
    marginLeft: -21,
    border: 'solid 1px',
    borderColor: theme.palette.grey[400],
    backgroundColor: theme.palette.grey[50],
    opacity: 1,
    transition: theme.transitions.create(['background-color', 'border']),
  },
  colorChecked: {},
  textField: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: 200,
  },
  textFieldFirst: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: '45%',
  },
  textFieldFirstID: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: '55%',
  },
  textFieldMax: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: '65%',
  },
  textFieldAfterRadio: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: '65%',
  },
  textAltered:{
    marginRight: theme.spacing.unit,
    width: '100%',
  },
  textField3em1Linha: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: '30%',
  },
  textField3em1LinhaLeft: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: '30%',
  },
  textFieldNaturalidade: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: '25%',
  },
  textFieldNumero: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: '15%',
  },
   root: {
    display: 'flex',
  },
  rootsave: {
    display: 'flex',
    marginTop: 10,
  },
  formControl: {
    margin: theme.spacing.unit * 1,
    marginTop: theme.spacing.unit * 2,
  },
  formControlDoubleRadio: {
    margin: theme.spacing.unit * 1,
    marginTop: theme.spacing.unit * 2,
  },
  group: {
    marginTop: theme.spacing.unit * 1,
  },
  dense: {
    marginTop: 19,
  },
  menu: {
    width: 200,
  },
  fontLabel:{
    fontWeight:'bold',
  },
  fontSwitch:{
    fontFamily:'Alegreya Sans',
    fontSize:30,
    color:'#025c'
  },
  fontInput:{
    fontWeight:'bold',
  }
});


class TextFields extends React.Component {
  state = {
    comorelacionamentofamiliar:'',
    usomedicamentospsiquiátricos:'',
    acompanhamentopsiquiátrico:'',
    avaliaqualidadedosono:'',

    tentativasuicídio:'',
    preconceito:'',
    conflitocomlei:'',
    violenciabullying:'',
    problemasrelacionamento:'',
    alcoolismo:'',
    usodedrogas:'',
    problemafinanceiro:'',
    prefironãodeclarar:'',
    outrosituações:'',
    outrosituaçõesoutro:'',
    nenhumadassituações:'',



    temrelacionamentoafetivo:'',
    relacionamentoconsidera:'',
    relacionamentoconsideraoutro:'',
    teverelaçãosexual:'',
    teverelaçãosexualsim:'',
    quantosparceiros:'',
    frequênciarelaçãosexual:'',
    relaçãoanaloral:'',
    orientaçãosexual:'',
    orientaçãosexualoutro:'',
    atraçãofísica:'',
    tevedst:'',
    tratamentodst:'',
    ondetratadst:'',
    usadroga:'',
    usadrogasim:'',
    usapreservativo:'',
    usapreservativonao:'',
    usadrogasexo:'',
    usadrogasexooutro:'',
    comoobterinformaçãooutro:'',
    internet:false,
    jornal:false,
    televisão:false,
    amigos:false,
    revistas:false,
    outro: false,
    exameaids:'',
    prevençãoaids:'',
    prevençãoaidsoutro:'',
    avaliaconhecimentoaids:'',
    iddoaluno:''
  };


  handleChangeSwitch1 = name => event => {
    this.setState({ [name]: event.target.checked });
  };


  alunoConsideraRelacionamento = (classeroot, classtextfieldnumero) => {
    if(this.state.relacionamentoconsidera == "6"){
    return (<div>
    <div className={classeroot}>
      <TextField
       id="relacionamentoconsideraoutro"
       label="Que tipo?"
       className={classtextfieldnumero}
       value={this.state.relacionamentoconsideraoutro}
       onChange={this.handleChange('relacionamentoconsideraoutro')}
       margin="normal"
       variant='outlined'
     />
   </div>
   </div>)
    }else{
      return(
      <div className={classeroot}>
      </div>)
    }
  }
  alunoTeveRelaçãoSexual = (classeroot, classtextfieldnumero) => {
    if(this.state.teverelaçãosexual == "2"){
    return (<div>
    <div className={classeroot}>
      <TextField
       id="teverelaçãosexualsim"
       label="Que idade?"
       className={classtextfieldnumero}
       value={this.state.teverelaçãosexualsim}
       onChange={this.handleChange('teverelaçãosexualsim')}
       margin="normal"
       variant='outlined'
     />
   </div>
   </div>)
    }else{
      return(
      <div className={classeroot}>
      </div>)
    }
  }
  alunoOrientaçãoSexual = (classeroot, classtextfieldnumero) => {
    if(this.state.orientaçãosexual == "5"){
    return (<div>
    <div className={classeroot}>
      <TextField
       id="orientaçãosexualoutro"
       label="Qual?"
       className={classtextfieldnumero}
       value={this.state.orientaçãosexualoutro}
       onChange={this.handleChange('orientaçãosexualoutro')}
       margin="normal"
       variant='outlined'
     />
   </div>
   </div>)
    }else{
      return(
      <div className={classeroot}>
      </div>)
    }
  }
  alunoSituaçõesAconteceram = (classeroot, classtextfieldnumero) => {
    if(this.state.outrosituações == true){
    return (<div>
    <div className={classeroot}>
      <TextField
       id="outrosituaçõesoutro"
       label="Qual?"
       className={classtextfieldnumero}
       value={this.state.outrosituaçõesoutro}
       onChange={this.handleChange('outrosituaçõesoutro')}
       margin="normal"
       variant='outlined'
     />
   </div>
   </div>)
    }else{
      return(
      <div className={classeroot}>
      </div>)
    }
  }
  alunoUsaDroga = (classeroot, classtextfieldnumero) => {
    if(this.state.usadroga == "3"){
    return (<div>
    <div className={classeroot}>
      <TextField
       id="usadrogasim"
       label="Qual?"
       className={classtextfieldnumero}
       value={this.state.usadrogasim}
       onChange={this.handleChange('usadrogasim')}
       margin="normal"
       variant='outlined'
     />
   </div>
   </div>)
    }else{
      return(
      <div className={classeroot}>
      </div>)
    }
  }
  alunoUsaDrogaSexo = (classeroot, classtextfieldnumero) => {
    if(this.state.usadrogasexo == "9"){
    return (<div>
    <div className={classeroot}>
      <TextField
       id="usadrogasexooutro"
       label="Qual?"
       className={classtextfieldnumero}
       value={this.state.usadrogasexooutro}
       onChange={this.handleChange('usadrogasexooutro')}
       margin="normal"
       variant='outlined'
     />
   </div>
   </div>)
    }else{
      return(
      <div className={classeroot}>
      </div>)
    }
  }
  alunoComoObterInformação = (classeroot, classtextfieldnumero) => {
    if(this.state.outro == true){
    return (<div>
    <div className={classeroot}>
      <TextField
       id="comoobterinformaçãooutro"
       label="Através de..."
       className={classtextfieldnumero}
       value={this.state.comoobterinformaçãooutro}
       onChange={this.handleChange('comoobterinformaçãooutro')}
       margin="normal"
       variant='outlined'
     />
   </div>
   </div>)
    }else{
      return(
      <div className={classeroot}>
      </div>)
    }
  }
  alunoPrevençãoAids = (classeroot, classtextfieldnumero) => {
    if(this.state.prevençãoaids == "7"){
    return (<div>
    <div className={classeroot}>
      <TextField
       id="prevençãoaidsoutro"
       label="Como ?"
       className={classtextfieldnumero}
       value={this.state.prevençãoaidsoutro}
       onChange={this.handleChange('prevençãoaidsoutro')}
       margin="normal"
       variant='outlined'
     />
   </div>
   </div>)
    }else{
      return(
      <div className={classeroot}>
      </div>)
    }
  }

  salvarDados = () => {
    if(this.state.iddoaluno == ""){
        alert('Adicione o ID do Aluno')
    }else{
    }
}
  handleChange = name => event => {
    this.setState({ [name]: event.target.value });
  };
  handleChangeCheckboxloco = name => event => {
    this.setState({ ...this.state, [name]: event.target.checked });
  };

  render() {
    const { classes } = this.props;
    return (
      <div>
    <div>
    <Grid container spacing={2}>
        <Grid item xs={10}>
        <Typography component="div">
        <Box fontWeight={400} textAlign='left' fontSize={36} fontFamily='Alegreya Sans' style={{color:'#4e5180'}} m={1}>
        {this.props.h1first}
      </Box>
    </Typography>
        </Grid>
        <Grid item xs={2}>
        <Typography component="div">
        <TextField
          id="standard-name"
          label="ID do Aluno"
          className={classes.textFieldFirstID}
          value={this.state.iddoaluno}
          onChange={this.handleChange('iddoaluno')}
          margin="normal"
          variant='outlined'
        />

    </Typography>
        </Grid>
      </Grid>
   </div>
      <form className={classes.container} noValidate autoComplete="off" style={{display:'block'}}>
      <div className={classes.root}>
        <FormControl component="fieldset" className={classes.formControl}>
          <FormLabel component="legend" style={{fontFamily:'Alegreya Sans',fontSize:20}}>Como está a sua satisfação com o seu relacionamento familiar ?</FormLabel>
          <RadioGroup
            aria-label="comorelacionamentofamiliar"
            name="comorelacionamentofamiliar"
            className={classes.group}
            value={this.state.comorelacionamentofamiliar}
            onChange={this.handleChange('comorelacionamentofamiliar')}
            row
          >
            <FormControlLabel value="1" control={<Radio color='primary'/>} label="Muito Satisfeito" />
            <FormControlLabel value="2" control={<Radio color='primary'/>} label="Satisfeito" />
            <FormControlLabel value="3" control={<Radio color='primary'/>} label="Satisfeito, mas mudaria algo" />
            <FormControlLabel value="4" control={<Radio color='primary'/>} label="Insatisfeito" />
            <FormControlLabel value="5" control={<Radio color='primary'/>} label="Muito Insatisfeito" />

          </RadioGroup>
        </FormControl>
      </div>
      <div className={classes.root}>
        <FormControl component="fieldset" className={classes.formControl}>
          <FormLabel component="legend" style={{fontFamily:'Alegreya Sans',fontSize:20}}>Você fez uso de medicamentos psiquiátricos nos últimos 12 meses ?</FormLabel>
          <RadioGroup
            aria-label="usomedicamentospsiquiátricos"
            name="usomedicamentospsiquiátricos"
            className={classes.group}
            value={this.state.usomedicamentospsiquiátricos}
            onChange={this.handleChange('usomedicamentospsiquiátricos')}
            row
          >
            <FormControlLabel value="1" control={<Radio color='primary'/>} label="Não" />
            <FormControlLabel value="2" control={<Radio color='primary'/>} label="Sim" />
          </RadioGroup>

        </FormControl>
      </div>
      <div className={classes.root}>
        <FormControl component="fieldset" className={classes.formControl}>
          <FormLabel component="legend" style={{fontFamily:'Alegreya Sans',fontSize:20}}>Você fez acompanhamento psiquiátrico ou psicológico nos últimos 12 meses ?</FormLabel>
          <RadioGroup
            aria-label="acompanhamentopsiquiátrico"
            name="acompanhamentopsiquiátrico"
            className={classes.group}
            value={this.state.acompanhamentopsiquiátrico}
            onChange={this.handleChange('acompanhamentopsiquiátrico')}
            row
          >
            <FormControlLabel value="1" control={<Radio color='primary'/>} label="Não" />
            <FormControlLabel value="2" control={<Radio color='primary'/>} label="Sim" />
          </RadioGroup>

        </FormControl>
      </div>
      <div className={classes.root}>
        <FormControl component="fieldset" className={classes.formControl}>
          <FormLabel component="legend" style={{fontFamily:'Alegreya Sans',fontSize:20}}>Como você avalia a qualidade do seu sono no último mês ?</FormLabel>
          <RadioGroup
            aria-label="avaliaqualidadedosono"
            name="avaliaqualidadedosono"
            className={classes.group}
            value={this.state.avaliaqualidadedosono}
            onChange={this.handleChange('avaliaqualidadedosono')}
            row
          >
            <FormControlLabel value="1" control={<Radio color='primary'/>} label="Considero que não houve alteração no meu sono" />
            <FormControlLabel value="2" control={<Radio color='primary'/>} label="Estou dormindo mais do que costumava dormir" />
            <FormControlLabel value="3" control={<Radio color='primary'/>} label="Estou dormindo menos do que costumava dormir" />

          </RadioGroup>
        </FormControl>
      </div>
      <div className={classes.root}>
        <FormControl component="fieldset" className={classes.formControl}>
          <FormLabel component="legend" style={{fontFamily:'Alegreya Sans',fontSize:20}}>Situações que aconteceram com você nos últimos 12 meses (pode marcar mais de uma alternativa)</FormLabel>
          <FormGroup 
          row
          >
            <FormControlLabel value={!this.state.tentativasuicídio} control={<Checkbox checked={this.state.tentativasuicídio} onChange={this.handleChangeCheckboxloco('tentativasuicídio')} color='primary'/>} label="Tentativa de Suicídio" />
            <FormControlLabel value={!this.state.preconceito} control={<Checkbox checked={this.state.preconceito} onChange={this.handleChangeCheckboxloco('preconceito')} color='primary'/>} label="Preconceito" />
            <FormControlLabel value={!this.state.conflitocomlei} control={<Checkbox checked={this.state.conflitocomlei} onChange={this.handleChangeCheckboxloco('conflitocomlei')} color='primary'/>} label="Conflito com a Lei" />
            <FormControlLabel value={!this.state.violenciabullying} control={<Checkbox checked={this.state.violenciabullying} onChange={this.handleChangeCheckboxloco('violenciabullying')} color='primary'/>} label="Violência / agressão/ bullying" />
            <FormControlLabel value={!this.state.problemasrelacionamento} control={<Checkbox checked={this.state.problemasrelacionamento} onChange={this.handleChangeCheckboxloco('problemasrelacionamento')} color='primary'/>} label="Problemas de relacionamento" />
            <FormControlLabel value={!this.state.alcoolismo} control={<Checkbox checked={this.state.alcoolismo} onChange={this.handleChangeCheckboxloco('alcoolismo')} color='primary'/>} label="Alcoolismo" />
            <FormControlLabel value={!this.state.usodedrogas} control={<Checkbox checked={this.state.usodedrogas} onChange={this.handleChangeCheckboxloco('usodedrogas')} color='primary'/>} label="Uso de drogas" />
            <FormControlLabel value={!this.state.problemafinanceiro} control={<Checkbox checked={this.state.problemafinanceiro} onChange={this.handleChangeCheckboxloco('problemafinanceiro')} color='primary'/>} label="Problema financeiro" />
            <FormControlLabel value={!this.state.prefironãodeclarar} control={<Checkbox checked={this.state.prefironãodeclarar} onChange={this.handleChangeCheckboxloco('prefironãodeclarar')} color='primary'/>} label="Prefiro não declarar" />
            <FormControlLabel value={!this.state.outrosituações} control={<Checkbox checked={this.state.outrosituações} onChange={this.handleChangeCheckboxloco('outrosituações')} color='primary'/>} label="Outro" />
            <FormControlLabel value={!this.state.nenhumadassituações} control={<Checkbox checked={this.state.nenhumadassituações} onChange={this.handleChangeCheckboxloco('nenhumadassituações')} color='primary'/>} label="Nenhuma das situações ocorreu" />


          </FormGroup>
          <FormHelperText>Escolha quantos quiser</FormHelperText>
          {this.alunoSituaçõesAconteceram()}
        </FormControl>
      </div>
      <div className={classes.root}>
        <FormControl component="fieldset" className={classes.formControl}>
          <FormLabel component="legend" style={{fontFamily:'Alegreya Sans',fontSize:20}}>Nos últimos 30 dias você teve relação sexual (anal ou oral) ?</FormLabel>
          <RadioGroup
            aria-label="relaçãoanaloral"
            name="relaçãoanaloral"
            className={classes.group}
            value={this.state.relaçãoanaloral}
            onChange={this.handleChange('relaçãoanaloral')}
            row
          >
            <FormControlLabel value="1" control={<Radio color='primary'/>} label="Não" />
            <FormControlLabel value="2" control={<Radio color='primary'/>} label="Sim, oral" />
            <FormControlLabel value="3" control={<Radio color='primary'/>} label="Sim, anal" />
            <FormControlLabel value="4" control={<Radio color='primary'/>} label="Sim, anal e oral" />
          </RadioGroup>
        </FormControl>
      </div>
      <div className={classes.root}>
        <FormControl component="fieldset" className={classes.formControl}>
          <FormLabel component="legend" style={{fontFamily:'Alegreya Sans',fontSize:20}}>Em relação a sua orientação sexual, você se considera ?</FormLabel>
          <RadioGroup
            aria-label="orientaçãosexual"
            name="orientaçãosexual"
            className={classes.group}
            value={this.state.orientaçãosexual}
            onChange={this.handleChange('orientaçãosexual')}
            row
          >
            <FormControlLabel value="1" control={<Radio color='primary'/>} label="Heterossexual" />
